export default function App() {
  return (
    <Router>
      <Layout> {/* Wrap the routes with Layout */}
        <Routes> {/* Use Routes instead of Switch */}
          <Route path="/" element={<Home />} /> {/* Update Route syntax */}
        </Routes>
      </Layout>
    </Router>
  );
}
